// justification:
//         xy == 1 (mod m)
//         xy =  1+km

// x[y(2-xy)] = 1-k^2m^2
// x[y(2-xy)] == 1 (mod m^2)
// if y is 1/x mod m, then y(2-xy) is 1/x mod m^2

  y = (y*(2-x*y%this.DV))%this.DV;		// y == 1/x mod 2^dbits
